function Card({name, link, like, card, onCardClick}) {

    const handleClick = () =>{
       onCardClick(card)
      }  

  return (
                <div className="element">
                    <img className="element__image" src={link} alt={name} onClick={handleClick}/>
                    <div className="element__item">
                        <p className="element__title" name="name">{name}</p>
                        <button className="element__delete"></button>
                        <div className="element__likes-and-number">
                            <button className="element__like"></button>
                            <p className="element__like-number">{card.like}</p>
                        </div>
                    </div>
                </div>
  )
}

export default Card;
